import React, { useState } from "react";
import { Link } from "react-router-dom"; // Import Link for navigation
import styles from "./Login.module.css";

const Login = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [rememberMe, setRememberMe] = useState(false);

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    console.log("Email:", email, "Password:", password, "Remember Me:", rememberMe);
    // Add login logic here
  };

  return (
    <div className={styles.loginPage}>
      {/* Left Section with Image and Text */}
      <div className={styles.leftSection}>
        <img
          src="https://via.placeholder.com/400x400" // Replace with your image URL
          alt="Welcome"
          className={styles.loginImage}
        />
        <h2>Welcome to QuizPro</h2>
        <p>Manage your classes, quizzes, and students all in one place.</p>
      </div>

      {/* Right Section with Login Form */}
      <div className={styles.rightSection}>
        <h1 className={styles.title}>Teacher Login</h1>
        <p className={styles.subtitle}>Please log in to access your dashboard.</p>
        <form onSubmit={handleSubmit} className={styles.loginForm}>
          <div className={styles.formGroup}>
            <label htmlFor="email">Email</label>
            <input
              type="email"
              id="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              placeholder="Enter your email"
              required
            />
          </div>
          <div className={styles.formGroup}>
            <label htmlFor="password">Password</label>
            <input
              type="password"
              id="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              placeholder="Enter your password"
              required
            />
          </div>
          <div className={styles.formGroupCheckbox}>
            <input
              type="checkbox"
              id="rememberMe"
              checked={rememberMe}
              onChange={(e) => setRememberMe(e.target.checked)}
            />
            <label htmlFor="rememberMe">Remember Me</label>
          </div>
          <button type="submit" className={styles.loginButton}>
            Log In
          </button>
        </form>
        <p className={styles.signUpText}>
          Don't have an account? <Link to="/signup">Sign Up</Link>
        </p>
      </div>
    </div>
  );
};

export default Login;
